import ajax from '../https'

const devIP = 'http://192.168.2.10:8000' // 开发IP地址
const testIP1 = 'http://47.102.115.64:8086' // 测试IP地址
const testIP2 = 'http://47.103.94.48:8806' // 绿灯测试IP地址
const testIP3 = 'http://47.103.143.165:8806' // 绿灯测试2IP地址
const product = 'http://47.88.228.146:8806' // 生产环境IP地址
const spare1 = 'http://45.32.119.58:8066' // 备用环境1IP地址
const spare2 = 'http://157.230.241.99:8066' // 备用环境2IP地址
const productRealmIP = 'http://sign.mars99999.cloud' // 生产环境（域名）IP地址
const chainDevIP = 'http://47.103.27.196:38002' // 本地链上获取余额
const chainTestIP = 'http://47.103.149.80:8001' // 测试链上获取余额
const chainTest2IP = 'http://47.103.132.18:8001' // 测试2链上获取余额
const chainProductIP = 'http://47.74.176.27:8000' // 生产环境链上获取余额
// const chainProductRealmIP = 'http://otc.emars99999.com' // 生产环境（域名）链上获取余额
const chainProductRealmIP = 'http://otc.mars99999.cloud' // 生产环境（域名）链上获取余额


export function userLogin(params) {
  // 注册钱包信息
  return ajax({
    url: spare2 + '/web/sgn/pbreq.do',
    method: 'post',
    data: params
  })
}

export function getBalance(params) {
  // 获取余额
  return ajax({
    url: chainProductRealmIP + '/fbs/act/pbgac.do',
    method: 'post',
    data: params
  })
}

export function getUserInfo(params) {
  // 获取注册信息
  return ajax({
    url: spare2 + '/web/sgn/pbbki.do',
    method: 'post',
    data: params
  })
}
